      SELECT DISTINCT - col2 AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT NULL NOT IN ( 62, - ( col0 ) * + - 15, - - 10 * - 77 + 68 * col1 + + 57 );
  - name: tab0

outputs:
  - name: q6709.out
    data: |
